import { useField } from 'formik'

const RadioFormulario = ({label, ...props}) => {
    const [field] = useField({ ...props, type: 'radio'});
    return(
        <>
            <span>
                <input type='radio' {...field} {...props}/>
                { label}
            </span>
        </>
    );
}

export default RadioFormulario;
